import React from 'react'

export function TodoList({arrayTodo}) {
  return (
    <ul>
        {
        arrayTodo.map( (elementoTodo) => 
                // ( <li>Tarea</li> )
                <TodoItem arrayTodo={elementoTodo} />
            )
        }
    </ul>
  )
}
